INSERT INTO `news` (`id`, `texname`, `text`, `img`, `date`) VALUES
(1, 'Ford получает по 15 заявок в минуту на пикап F-150 Lightning\r\n', 'Глава Ford Motor Джим Фарли сообщил о небывалом спросе на электрическускую версию пикапа F-150. За первые 48 часов после презентации компания получила более 44 500 заказов.', , '2023-01-11');
INSERT INTO `news` (`id`, `texname`, `text`, `img`, `date`) VALUES
(2, 'Самый популярный пикап Америки стал электромобилем', 'Компания Ford официально представила электрическую версию пикапа F-150. Она получила обозначение Lightning (Молния), огромный багажник под капотом, несколько бытовых розеток, мощную силовую установку и более прочную раму. Динамику нового электрокара уже успел оценить президент США Джо Байден.', , '2023-01-01');

