(64, ' Febi', 'Пыльник приводного вала наружный, комплект', '350.00', 3, , 99, 66, '<h3>Характеристики</h3>\r\nВес [кг]:0.25</br>\r\nВнутренний диаметр 1 [мм]:26</br>\r\nВнутренний диаметр 2 [мм]:87</br>\r\nДлина [мм]:115</br>\r\n</br>\r\n<h3>О производителе</h3>\r\nМатериал изготовления:	Термопласт\r\nПервый торговый бизнес компании был основан еще в 1844 году, но со временем приоритет сместился в производство. Запчасти под брендом febi выпускаются концерном Ferdinand Bilstein. Также в портфель входят бренды SWAG и BluePrint. Компания имеет представительства в 21 стране, работает через партнеров в 70 странах и поставляет свои товары в 150 стран. Вне зависимости от места производства, все запчасти соответствуют международным стандартам, требованиям автопроизводителей и высоким ожиданиям клиентов к продукции «Made in Germany».', 'gdfg4', 495, '29609 ', 'male');
